(function() {
    function setProfileImage(logo, positionSet){
        
        //Get All Images
         for(var i = 2; i<document.getElementsByClassName("img-thumbnail").length; i++){
            var party = document.getElementsByClassName("img-thumbnail")[i];
            //Scenario 1: (All Participants)
            var position = document.getElementsByClassName("PosicionCandidato")[i-2];
            if (position != undefined && position.innerText == positionSet){
               party.setAttribute("src", logo);
            }
        
            if (position == undefined){
               position = document.getElementsByClassName("posicionConfirmar")[i-2];
               if (position != undefined && position.innerText == positionSet){
                    party.setAttribute("src", logo);
               }
            }
        }
    }
    var title = document.getElementsByClassName("hTituloPrincipales")[1];
    var logo = "";
    var position = 0;
    if (title == undefined){
        title = document.getElementsByClassName("heid")[0];
    }

     //Know when page is.
     if (title != undefined){
        console.log(title.innerText);
        switch(title.innerText){
            case "PARTIDO POLITICO":
             logo = "data:image/jpeg;base64,";
             var party = document.getElementsByClassName("imagenCandidato")[1];
             if (party == undefined){
                party = document.getElementsByClassName("img-thumbnail")[0];
             }
             party.setAttribute("src", logo);
             break;
            case "PRESIDENTE(A)":
             logo = "data:image/jpeg;base64,";
             setProfileImage(logo, "1");
             break;
            case "DIPUTADO(A)":
              

             break;
            case "ALCALDE(SA)":
                break;
            case "REGIDOR(A)":
                logo = "data:image/jpeg;base64,";
                    setProfileImage(logo, "17")
                break;

        }
     }
    
 })();
